    <script>
        $(document).on('change', '#delivery_timeframe', function() {
            selectedDeliveryTimeframe = $(this).val();
            if (selectedDeliveryTimeframe == 'On a Specific Date' || selectedDeliveryTimeframe == 'Between Specific Dates') {
                $('#delivery_timeframe').toggle();
                // Set default option to "ASAP"
                $('#delivery_timeframe').val('ASAP');
                $('#delivery_timeframe_date').toggleClass('d-none');
                // Check if the element has the 'd-none' class
                if (!$('#delivery_timeframe_date').hasClass('d-none')) {
                    if (isIOSDevice()) {
                        $('#delivery_timeframe_date').focus();
                    } else {
                        $("#delivery_timeframe_date").datepicker("show");
                    }
                }
                $('#delivery_timeframe_date').addClass('wizard-required');
            }  // Add a closing bracket here
            else {
                $('#delivery_timeframe_date').removeClass('wizard-required');
            }
        });

        function deliveryTimeframe() {
            var selectedDeliveryTimeframe = $('#delivery_timeframe').val();
            $('#delivery_timeframe').toggle();
            // Set default option to "ASAP"
            $('#delivery_timeframe').val('ASAP');
            $('#delivery_timeframe_date').toggleClass('d-none');
            // Check if the element has the 'd-none' class
            if (!$('#delivery_timeframe_date').hasClass('d-none')) {
                if (isIOSDevice()) {
                    $('#delivery_timeframe_date').focus();
                } else {
                    $("#delivery_timeframe_date").datepicker("show");
                }
            }
            if(selectedDeliveryTimeframe == 'ASAP') {
                $('#delivery_timeframe_date').val('');
            }
        }
        // Custom validation method to check for phone number or email
        $.validator.addMethod("noPhoneOrEmail", function(value, element) {
            var contains_email = /\b[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}\b/i.test(value);
            var contains_six_or_more_digits = /\d{6,}/.test(value.replace(/\D/g, ''));
            return !(contains_email || contains_six_or_more_digits);
        });

        // Custom method to check if delivery_timeframe_date is required
        $.validator.addMethod("deliveryDateRequired", function (value, element) {
            if ((selectedDeliveryTimeframe === 'On a Specific Date' || selectedDeliveryTimeframe === 'Between Specific Dates') && value === "") {                
                return false;
            } 
            return true;
        }, "Please enter a delivery date.");
